import React from "react";

export class ClickTraker extends React.Component {
  trackerButtonClick = (event) => {
    return event.target
  };

  render() {
    return (
      <div>
        <button onClick={this.trackerButtonClick}>Button one</button>
        <button onClick={this.trackerButtonClick}>Button two</button>
        <button onClick={this.trackerButtonClick}>button three</button>
        <h1>{event.target}</h1>
      </div>
    );
  }
}
